using System;
using System.Collections.Generic;
using System.Linq;

namespace BasicsPractice
{
    public class GeometricTrick
    {
        private static int geometricTrick(string s)
        {
            Console.WriteLine($"Output: " + s.Length);
            Dictionary<int, int>[] hash = new Dictionary<int, int>[3];
            for (int r = 0; r < s.Length; r++)
            {
                if (s[r] == 'a')
                {
                    if (hash[0] == null)
                    {
                        hash[0] = new Dictionary<int, int>();
                    }
                    hash[0].Add(r, r);
                }
                else if (s[r] == 'b')
                {
                    if (hash[1] == null)
                    {
                        hash[1] = new Dictionary<int, int>();
                    }
                    hash[1].Add(r, r);
                }
                else
                {
                    if (hash[2] == null)
                    {
                        hash[2] = new Dictionary<int, int>();
                    }
                    hash[2].Add(r, r);
                }
            }
            int total = 0;
            foreach (var i in hash[0])
            {
                foreach (var j in hash[1])
                {
                    var k = (Math.Pow(j.Key, 2) + (2 * j.Key) - i.Key) / (1 + i.Key);
                    bool isNum = k % 1 == 0;
                    int key = 0;
                    if (isNum && hash[2].TryGetValue((int)k, out key))
                    {
                        total++;
                    }
                }
            }
            return total;
        }

        private static void MainGT(String[] args)
        {
            int n = 500000;//Convert.ToInt32(Console.ReadLine());
            //string s =Console.ReadLine();
            string s = "";
            int result = geometricTrick(s);
            Console.WriteLine(result);
        }
    }
}